    <style type="text/css">
        .loadmask {
            position: absolute;
            left: 0;
            top: 0;
            height: 100%;
            width: 100%;
            overflow: hidden;
            border: none;
            background-color: #f4f4f4;
            z-index: 20002;
        }

        .loadmask-body {
            position:relative;
            top:44%;
        }

        .loadmask-logo {
            display: inline-block;
            min-width: 240px;
            vertical-align: top;
            background-image: url('./resources/img/loading-logo.gif');
            background-image: -webkit-image-set(url('./resources/img/loading-logo.gif') 1x, url('./resources/img/loading-logo@2x.gif') 2x);
            background-repeat: no-repeat;
        }

        #loadmask-text {
            color: #b2b2b2;
            font-size: 10px;
            font-weight: bold;
            font-family: Arial;
            height:14px;
            margin-top:32px;
            padding-left:40px;
            text-align:left;
            text-transform: uppercase;
        }
    </style>
